	public void coverup(String site,int k){
		String url=_nodeFile.get(site);
		ArrayList<String> visited=new ArrayList<String>();
		Queue<String> toVisit = new LinkedList<String>();
		toVisit.addAll(_incoming.get(url));
		visited.add(url);
		int size=toVisit.size();
		int i=1;
		int count=0;
		String p="";
		_incoming.remove(url);
		while(count<k){
			p=toVisit.remove();
			if(i==size){
				count=count+1;
				size=toVisit.size();
			}
			if(!visited.contains(p)){
				toVisit.addAll(_incoming.get(p));
				_incoming.remove(p);
				visited.add(p);
			}
			i++;
		}
	}
	public static void main(String args[]){
		WebGraph G = new WebGraph();
		if(args[0].equals("-prune")){
			String nodeFilename=args[1]; 
			String edgeFilename=args[2];
			String outputFilename=args[3];
			int k=Integer.parseInt(args[4]);
			G.initializeNode(nodeFilename);
			try {
				FileReader fis=new FileReader(edgeFilename);
				BufferedReader br=new BufferedReader(fis);
				String line="";
				while((line=br.readLine())!=null){
					String[] links=line.split("\t");
					G.insertEdge(links[0], links[1]);
				}
				br.close();
			} catch (FileNotFoundException e) {
				e.printStackTrace();
			} catch (IOException e) {
				e.printStackTrace();
			}
			G.prune(k);
			try {
				File statText = new File(outputFilename);
				FileOutputStream is = new FileOutputStream(statText);
				OutputStreamWriter osw = new OutputStreamWriter(is);    
				Writer w = new BufferedWriter(osw);
				for(String a:G._graph.keySet()){
					for(int i=0;i<G._graph.get(a).size();i++){
						w.write(a+"\t"+G._graph.get(a).get(i)+"\n");
					}
				}
				w.close();
				} catch (IOException e) {
					System.err.println("Problem writing to the file");
			}
		}
		else if(args[0].equals("-path")){
			String nodeFilename=args[1];
			String edgeFilename=args[2];
			String outputFilename=args[3];
			String startURL=args[4];
			String destinationURL=args[5];
			G.initializeNode(nodeFilename);
			try {
				FileReader fis=new FileReader(edgeFilename);
				BufferedReader br=new BufferedReader(fis);
				String line="";
				while((line=br.readLine())!=null){
					String[] links=line.split("\t");
					G.insertEdge(links[0], links[1]);
				}
				br.close();
			} catch (FileNotFoundException e) {
				e.printStackTrace();
			} catch (IOException e) {
				e.printStackTrace();
			}
			G.shortestNaviagtionPath(startURL, destinationURL,outputFilename);
		}
		else if(args[0].equals("-cover")){
			String nodeFilename=args[1];
			String edgeFilename=args[2];
			String outputFilename=args[3];
			int k=Integer.parseInt(args[4]);
			String url=args[5];
			G.initializeNode(nodeFilename);
			try {
				FileReader fis=new FileReader(edgeFilename);
				BufferedReader br=new BufferedReader(fis);
				String line="";
				while((line=br.readLine())!=null){
					String[] links=line.split("\t");
					G.insertEdge(links[0], links[1]);
				}
				br.close();
			} catch (FileNotFoundException e) {
				e.printStackTrace();
			} catch (IOException e) {
				e.printStackTrace();
			}
			G.coverup(url, k);
			try {
				File statText = new File(outputFilename);
				FileOutputStream is = new FileOutputStream(statText);
				OutputStreamWriter osw = new OutputStreamWriter(is);    
				Writer w = new BufferedWriter(osw);
				for(String a:G._incoming.keySet()){
					for(int i=0;i<G._incoming.get(a).size();i++){
						w.write(a+"\t"+G._incoming.get(a).get(i)+"\n");
					}
				}
				w.close();
				} catch (IOException e) {
					System.err.println("Problem writing to the file");
			}
		}
	}
